// Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import Logo from "../Assets/Images/logo.png"

const Header = () => {
    return (
        <header className="w-full h-32 bg-gradient-to-br from-green-400 via-green-400 to-black text-white p-4 flex items-center justify-between">
            <div className="absolute left-20 top-8">
                <Link to="/">
                    <img src={Logo} alt="logo-site" className="w-20 h-70%" />
                </Link>
            </div>

            <div className="absolute left-1/4 top-2/5 flex space-x-6">
                {/* acc */}
                <div className="h-22.5 flex justify-center items-center">
                    <Link to="/">
                        <div className="acc-1 text-black text-2xl font-bold font-serif break-words">Home</div>
                    </Link>
                </div>
                {/* abou */}
                <div className="abou h-22.5 flex justify-center items-center">
                    <Link to="/About">
                        <div className="abou-1 text-black text-2xl font-bold font-serif break-words">About Us</div>
                    </Link>
                </div>
                {/* cont */}
                <div className="cont h-22.5 flex justify-center items-center">
                    <Link to="/Contact">
                        <div className="cont-1 text-black text-2xl font-bold font-serif break-words">Contact Us</div>
                    </Link>
                </div>
            </div>

            <div className="frame-2 absolute right-10 top-1/4 flex items-center gap-6">
                {/* conn */}
                <div className="conn h-22.5 flex justify-center items-center">
                    <Link to="/Login">
                        <div className="conn-1 text-green-400 text-2xl font-bold font-serif break-words">Se Connecter</div>
                    </Link>
                </div>
                {/* inscr */}
                <div className="inscr h-22.5 flex justify-center items-center">
                    <Link to="/Register">
                        <div className="inscr-1 text-black text-2xl font-bold font-serif break-words">Inscrivez-vous</div>
                    </Link>
                </div>
            </div>
        </header>
    );
};

export default Header;
